import classes from './Chat.module.css';
import Rooms from './Rooms/Rooms';
import { RoomContextProvider } from '../../store/room-context';

const Chat = () => {
  return (
    <RoomContextProvider>
      <section className={classes.starting}>
        <div className={classes.boxes}><Rooms /></div>
      </section>
    </RoomContextProvider>
  );
};

export default Chat;
